import "./TodoCounter.css";

function TodoCounter({ completed, total }) {
  return (
    <h1 className="TodoCounter">
      {completed < total
        ? `Has completado ${completed} de ${total} TODOs`
        : `Has completado todos los TODOs`}
    </h1>
  );
}

export { TodoCounter };
